window.bookSummaryJSON = "<p>Jak and his allies venture through the portal in search of the longevity plant their king demands, but all Jak wants is to find the elder dragons.</p> <p>Some say they’re extinct. Some say they’re in hiding.</p> <p>If he can’t locate them, there won’t be anyone to teach his hatchling how to fly. Or to protect the dragon eggs preserved within a glacier on another world. Or to help him free his people from the tyrannical rule of the wizards.</p> <p>Jak has no choice. He <i>must </i>find the dragons.</p> <p>But some ancient secrets were buried for a reason. What he discovers may jeopardize not only Jak and his allies—the survival of the entire species of dragons may be at stake.</p>"; 
